import React, { useEffect, useState } from 'react';
import logo from './logo.png'; // replace with the path to your logo
import Pusher from 'pusher-js';
import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip, Legend, PieChart, Pie } from 'recharts';
import './styles.css';

function App() {
  const [lineData, setLineData] = useState([]);
  const [scoreData, setScoreData] = useState({ name: 'Score', value: 0 });
  const [depthData, setDepthData] = useState({ name: 'Depth', value: 0 });
  const [pressureData, setPressureData] = useState({ name: 'Pressure', value: 0 });
  const [isLive, setIsLive] = useState(false);
  const [startTime, setStartTime] = useState(null);

  useEffect(() => {
    document.title = "Rebeat"; // replace with your title

    let link = document.querySelector("link[rel*='icon']") || document.createElement('link');
    link.type = 'image/x-icon';
    link.rel = 'shortcut icon';
    link.href = logo;
    document.getElementsByTagName('head')[0].appendChild(link);

    const pusher = new Pusher('af314e57292c6a5efb2a', {
      cluster: 'ap3',
    });

    const channel = pusher.subscribe('my-channel');
    let timeoutId = null;

    channel.bind('my-event', (newData) => {
      if (!startTime) {
        setStartTime(new Date());
      }
      setIsLive(true);
      const transformedData = transformData(newData);
      setLineData((prevData) => {
        const updatedData = [...prevData, transformedData];
        const MAX_DATA_LENGTH = 30;
        return updatedData.slice(-MAX_DATA_LENGTH);
      });
      setScoreData({ name: 'Score', value: newData.score });
      setDepthData({ name: 'Depth', value: newData.depth });
      setPressureData({ name: 'Pressure', value: newData.pressure });

      if (timeoutId) {
        clearTimeout(timeoutId);
      }

      timeoutId = setTimeout(() => {
        setIsLive(false);
      }, 500);  // Change this line
    });

    return () => {
      channel.unbind_all();
      channel.unsubscribe();
    };
  }, [startTime]);

  function transformData(newData) {
    const currentTime = startTime ? formatElapsedTime(new Date() - startTime) : "00:00:00";
    return { name: currentTime, ...newData };
  }

  function formatElapsedTime(milliseconds) {
    const totalSeconds = Math.floor(milliseconds / 1000);
    const hours = Math.floor(totalSeconds / 3600);
    const minutes = Math.floor((totalSeconds % 3600) / 60);
    const seconds = totalSeconds % 60;
    return `${hours.toString().padStart(2, '0')}:${minutes.toString().padStart(2, '0')}:${seconds.toString().padStart(2, '0')}`;
  }

  const COLORS = ['#767FE8', '#FBD869', '#93EBB2'];

  return (
    <div className="contents">
      <div className="App-header">
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <img src={logo} alt="logo" style={{ marginRight: '10px', marginLeft:'20px' }} />
          <p style={{ color: '#000', fontSize: '25.42px' }}>REBEAT</p>
        </div>
      </div>
      <div>
        <PieChart width={400} height={400}>
          <Pie
            dataKey="value"
            isAnimationActive={isLive}
            data={[scoreData]}
            cx={200}
            cy={250}
            outerRadius={70}
            innerRadius={50}
            fill={COLORS[0]}
            labelLine={false}
            label={({ percent }) => `${(percent * 100).toFixed(0)}%`}
          />
          <Pie
            dataKey="value"
            isAnimationActive={isLive}
            data={[depthData]}
            cx={200}
            cy={250}
            outerRadius={90}
            innerRadius={70}
            fill={COLORS[1]}
            labelLine={false}
            label={({ percent }) => `${(percent * 100).toFixed(0)}%`}
          />
          <Pie
            dataKey="value"
            isAnimationActive={isLive}
            data={[pressureData]}
            cx={200}
            cy={250}
            outerRadius={110}
            innerRadius={90}
            fill={COLORS[2]}
            labelLine={false}
            label={({ percent }) => `${(percent * 100).toFixed(0)}%`}
          />
        </PieChart>
      </div>
      <div style={{ marginTop: '40px' }}>
        <LineChart
          width={1750}
          height={400}
          data={lineData}
          margin={{
            top: 40,
            right: 30,
            left: 20,
            bottom: 5
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="score" stroke="#8884d8" activeDot={{ r: 8 }} isAnimationActive={false} />
        </LineChart>
      </div>
      {isLive && <div style={{ position: 'absolute', top: 170, right: 100, padding: 10, backgroundColor: 'red', color: 'white', borderRadius: '40px' }}>Live</div>}
    </div>
  )
}

export default App;
